import { BrowserRouter, Route, Routes } from 'react-router-dom';
import React, { useState } from 'react';
import Login from './components/Login/Login';
import Dashboard from './components/Deshboard/Deshboard';
import Header from './components/Header/Header';
import MainHeader from './components/MainHeader/MainHeader';
import People from './components/Sidebar/People';
import AddPeople from './components/Sidebar/AddPeople';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const loginHandler = (email, password) => {
    // We should of course check email and password
    // But it's just a dummy/ demo anyways
    setIsLoggedIn(true);
  };

  const logoutHandler = () => {
    setIsLoggedIn(false);
  };

  return (
    <BrowserRouter>
    <Routes>
      {/* <Route isAuthenticated={isLoggedIn} onLogout={logoutHandler} /> */}
      <Switch>
      <Route path="/" element={ <Login/>}/>
      <Route path='dashboard' element={<Dashboard/>}/>
      <Route path="logout" element={<Header /> }/>
      <Route path='people' element={<People/>}/>  
      <Route path='addPeople' element={<AddPeople/>}/>
      </Switch>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
